import {
	HomeContainer,
	LeftContainer,
	RightContainer
}from './style.js';

class Home extends Component{

	render() {
		return (
			<HomeContainer>
				<LeftContainer>
				</LeftContainer>
				<RightContainer>
				</RightContainer>
			</HomeContainer>
		)
	}
}

export default Home;
